import { Fragment } from "react"
import "./filterbox.css";
import '../singleFilter/singleFilter'

export const FilterBox = () => {
    return (
       <Fragment>
            <h1>Filter</h1>
            <h2>Filter Tutors</h2>
            <div id="filters">
                <label><input type="checkbox" value="online"/> Online</label>
                <label><input type="checkbox" value="inperson"/> In-Person</label>
                <label><input type="checkbox" value="home"/> Home Tutors</label>
            </div>
       </Fragment>

    )
}
